import { useEffect } from 'react'
import { Redirect } from 'react-router-dom'
import { getRegisterEmail, removeRegisterEmail } from 'utils/cookiesHooks'
import { useHistory } from 'react-router-dom'

const VerifikasiEmail = () => {
  const history = useHistory()
  useEffect(() => {
    if (getRegisterEmail() === 'sukses') {
      removeRegisterEmail()
    }
  }, [])

  if (!getRegisterEmail()) {
    return <Redirect to="/register" />
  }

  return (
    <div className="mx-auto" style={{ maxWidth: '430px' }}>
      <div className="mx-[30px]">
        <div className="w-full mb-6 mt-[20vh] justify-center flex align-middle">
          <svg
            xmlns="http://www.w3.org/2000/svg"
            xmlnsXlink="http://www.w3.org/1999/xlink"
            width="209"
            height="209"
            fill="none"
            viewBox="0 0 209 209"
          >
            <path fill="url(#pattern0)" d="M0 0H209V209H0z"></path>
            <defs>
              <pattern
                id="pattern0"
                width="1"
                height="1"
                patternContentUnits="objectBoundingBox"
              >
                <use
                  transform="scale(.00222)"
                  xlinkHref="#image0_398_892"
                ></use>
              </pattern>
              <image
                id="image0_398_892"
                width="450"
                height="450"
                xlinkHref="data:image/png;base64,"
              ></image>
            </defs>
          </svg>
        </div>

        <div className="mx-[30px] mt-6">
          <p className="text-2xl font-bold text-peduly-dark text-center">
            Selangkah lagi!
          </p>

          <p className="text-base font-normal mt-[12px] text-center mx-[25px]">
            Silahkan cek email untuk melakukan verifikasi akun terlebih dahulu.
          </p>
        </div>

        <div className="w-full flex flex-col justify-center my-16">
          <button
            className="bg-peduly-primary text-white w-full font-bold rounded-full text-[18px] py-[18px] h-[60px]"
            onClick={() => {
              history.push('/login')
            }}
          >
            Mulai Login
          </button>
        </div>
      </div>
    </div>
  )
}

export default VerifikasiEmail
